import React from 'react';
import ProjData from './ProjData';

const ProjCard1 = (prop) =>{
    return (
        <>
                                <div className="card mx-3" style={{width: '18rem'}}>
                    <img src={prop.imgsrc} className="card-img-top align-items-center justify-content-center" alt='..icon'/>
                        <div className="card-body">
                            <h5 className="card-title mt-2">{prop.title}</h5>
                            <p className="card-text mt-2">{prop.text}</p>
                        </div>
                    </div>                    
        </>
    );
};
export default ProjCard1;
